syntax = "proto3";

package com.contract.uof;
option java_outer_classname = "OutcomeUOF";

import "google/protobuf/timestamp.proto";
import "google/protobuf/wrappers.proto";

message OutcomeProto {
  google.protobuf.StringValue id = 1;
  google.protobuf.StringValue odds = 2;
  google.protobuf.StringValue active = 3;
}